import React, { Component } from "react";

class UserItem extends Component {
  constructor() {
    super();
    this.state = {
      id: 10939256,
      login: "eder13",
      avatar_url: "https://avatars1.githubusercontent.com/u/10939256?v=4",
      html_url: "https://github.com/eder13",
    };
  }

  render() {
    return (
      <div className="card text-center">
        <img
          src={this.state.avatar_url}
          alt=""
          className="round-img"
          style={{ width: "60px" }}
        />
        <h3>{this.state.login}</h3>
        <a className="btn btn-dark btn-sm mt-2" href={this.state.html_url}>
          Profile
        </a>
      </div>
    );
  }
}

export default UserItem;
